import React from "react";

const About = () => {
  return (
    <section id="about" className="about-section">
      <div className="container">
        <h2 className="text-center">About Me</h2>
        <p>
          I am currently a Computer Science student at BINUS University, driven by a deep passion for programming. Since a young age, I’ve been fascinated by technology and how it shapes the world around us. This curiosity naturally led me
          to pursue a degree in Computer Science, where I’ve been able to sharpen my skills in a wide variety of programming languages and frameworks.
        </p>
        <p>
          My journey in coding has been fueled by a desire to continuously learn and challenge myself with new technologies. Among my primary interests is web development, a field I find particularly exciting because of its rapid evolution.
          I enjoy working on projects that push the boundaries of interactivity and creativity, and I’m always eager to learn the latest trends in web design and development.
        </p>
        <p>
          As I look toward the future, my goal is to expand my expertise in languages such as Golang, Swift, Ruby, and Kotlin, which are gaining popularity in the programming community. After graduation, I aspire to work at leading tech
          companies where I can contribute to cutting-edge innovations and be part of teams that shape the future of technology.
        </p>
      </div>
    </section>
  );
};

export default About;
